实现；中值滤波和均值滤波的区别。','通过课堂讲授，代码演示，翻转课堂，提问，项目驱动和学生实验过程，让学生掌握空间域平滑滤波，空间域锐化滤波，最大值，中值和最小值滤波。','[\"2.3\"]','[\"考试\",\"作业\",\"实验\"]'),(105,29,'数字图像处理','7','掌握一维离散傅里叶变换；掌握二维离散傅里叶变换；掌握正反变换的可分离性； 掌握时域和频域的平移性；掌握尺度变换；掌握旋转性；掌握平均值；掌握卷积定理；掌握相关性； 掌握图像的傅里叶变换及其能够分析运行出来的频谱图。','通过课堂讲授，代码演示，提问和学生实验过程，让学生掌握二维傅里叶变换及其性质，同时能够分析和能够编程得出图像的幅频图。','[\"1.3\",\"1.4\"]','[\"考试\",\"作业\",\"实验\"]'),(106,29,'数字图像处理','8','频域中实现各种滤波；掌握频域平滑滤波器；掌握频域锐化滤波器；掌握每类各种滤波器的性能差异；掌握空间滤波和频域滤波的关系；综合应用各种增强方法实现图像的增强。','通过课堂讲授，代码演示，翻转课堂，提问，项目驱动和学生实验过程，让学生掌握频域平滑滤波器、频域锐化滤波器、空间滤波和频域滤波的关系，能够综合应用各种增强方法实现图像的增强。','[\"2.1\",\"2.2\"]','[\"考试\",\"作业\",\"实验\"]'),(107,29,'数字图像处理','9','掌握彩色图像的三原色原理；根据实际项目需要，能够准确的实现不同的彩色空间的相互转换；掌握伪彩色图像的处理；掌握灰度变换和直方图均衡化实现彩色图像的增强处理； 能够用程序实现图像的各种平滑和锐化处理。','通过课堂讲授，代码演示，翻转课堂，提问，项目驱动和学生实验过程，让学生掌握彩色空间、伪彩色图像的处理、灰度变换和直方图均衡化实现彩色图像的增强处理、彩色图像的平滑和锐化处理。','[\"2.1\",\"2.2\"]','[\"考试\",\"作业\",\"实验\"]'),(108,29,'数字图像处理','10','掌握集合的并，交，补和差；掌握集合的反射，和集合的移位；掌握膨胀和腐蚀的原理和作用；掌握开操作和闭操作的原理和作用； 掌握形态学处理实现图像边缘提取、区域填充、连通分量的提取、凸壳、细化或粗化','通过课堂讲授，代码演示，翻转课堂，提问，项目驱动和学生实验过程，让学生掌握膨胀、腐蚀、开操作和闭操作的原理和作用；掌握形态学处理实现图像边缘提取、区域填充、连通分量的提取、凸壳、细化或粗化。','[\"2.2\",\"2.1\"]','[\"考试\",\"作业\",\"实验\"]'),(109,29,'数字图像处理','11','掌握点检测理论；掌握线检测理论；掌握边缘检测理论；掌握局部处理的理论；掌握hough变换的基本思想；掌握全局阈值，自适应阈值，最佳全局和自适应阈值，边界特性选择阈值，不同变量的阈值的数学算法；掌握区域的分割的原理；应用具有将相关原理和方法进行复杂工程问题的综合和设计的能力。','通过课堂讲授，代码演示，翻转课堂，提问，项目驱动和学生实验过程，让学生掌握点、线和边缘检测理论；掌握hough变换的基本思想；掌握全局阈值，自适应阈值，最佳全局和自适应阈值，边界特性选择阈值，不同变量的阈值的数学算法；掌握区域的分割的原理。','[\"1.4\",\"2.2\"]','[\"考试\",\"作业\",\"实验\"]'),(110,30,'离散数学','1','理解各种离散结构的基本思想、构造方法、主要概念和性质。熟练掌握各种基本公式、基本方法和计算、证明过程及抽象方法，培养对数学模型问题的分析能力以及对数学方法的应用能力。','通过课堂讲解、课后练习、课堂互动等手段，帮助学生培养逻辑思维能力和计算机思维。','[\"1.1\"]','[\"作业\"]'),(111,30,'离散数学','2','培养逻辑思维能力，通过对离散数学的系统学习，通过对自然语言的深入剖析，使学生采用计算机思维来完成推理过程，提高学生的分析与综合能力、归纳与演绎能力、比较能力和发散思维能力','以启发式、研讨式教学方法为主，通过课堂讲解、案例分析、课堂讨论、等诸多教学手段，培养学生的逻辑思维。','[\"2.2\"]','[\"作业\"]'),(112,30,'离散数学','3','培养解决复杂工程问题的能力。通过对离散数学的系统学习，能够对实际工程问题建立模型、分析模型，并利用模型解决问题。','灵活运用传授式、引导式和启发式等教学方法，通过重点/难点内容讲解、课后作业、布置学生文献查阅、进行课堂互动等模式，帮助学生掌握离散数学的基本知识，并能够将这些知识用于理解、描述和解决复杂工程问题。','[]','[\"作